const dataLoadsDefaultState = {
  dataLoadStatus: false,
};

export default (state = dataLoadsDefaultState, action) => {
  switch (action.type) {
    case 'DATA_LOAD_STATUS':
      return {
        ...state,
        dataLoadStatus: action.payload,
      };
    default:
      return state;
  }
};
